import React from 'react'
import { Menu } from 'antd'
import { Link } from 'react-router-dom'
function Sidebar(){
    return(
            <Link to='/'>
                <Menu.Item key="1">Home</Menu.Item>
            </Link>
    )
}
export default Sidebar
